    function makeDate(el) {
        console.log('here');
        let text = document.getElementById(el).textContent;
        text = text.split('-');
        text = text[2] + '-' + text[1] + '-' + text[0];
        document.getElementById(el).innerHTML = text;
        return text;
    }

    document.addEventListener('DOMContentLoaded', (event) => {
        makeDate('birthday');

